define('../../../../_baseClient/_base/js/desktop/resources/audio/player',['jquery'], function($) {

	var audio = function(template, data) {
		var self = this;

		this.init = function() {
			/*Checar Função compile para observar que objetos são atrelados ao objeto principal
			- this.template
			- this.data
			- this.compiled
			- this.el
			- this.$el
			*/
			$.extend(true, this, new Player.Helpers.resourceExtend(this, arguments));

			var audio = this;

			Player.Elements.$content.on({
				contentReady: function() {
					audio.bindAudioEvents();
				}
			});

		}

		this.in = function() {
			var audio = this,
				player = audio.player;

			if (!audio.data.autoplay || !audio.data.src || !audio.data.type) return;

			player.play();
			
		},

		this.out = function() {
			var audio = this,
				player = audio.player;

			if (!player.played) return;

			this.player = this.renderAudiojs();
			audio.bindAudioEvents();
		},

		this.bindAudioEvents = function() {
			var audio = this,
				player = audio.player;

			

			player

			.one('play', function() {
				player.played = true;
			})

			.on("play", function() {
				
				if (audio.data.lock) {
					audio.lockPlayer(true);
				}
			})

			.on("error", function() {
				
				if (audio.data.lock) {
					audio.lockPlayer(false);
				}
			})

			.on("ended", function() {
				
				if (audio.data.lock) {
					audio.lockPlayer(false);
				}
			})

			.on("fullscreenchange", function() {
				
				audio.$el.css('-webkit-animation', 'none');
			});

			if (audio.data.lock && !audio.data.src) {
				audio.lockPlayer(false);
			}
		}
	}

	return audio;
});
